import 'package:flutter/material.dart';
import 'dart:async';

import 'package:flutter/services.dart';
import 'package:flutter_sunmi_printer/flutter_sunmi_printer.dart';

void main() => runApp(MyApp());

class MyApp extends StatefulWidget {
  @override
  _MyAppState createState() => _MyAppState();
}

class _MyAppState extends State<MyApp> {

  @override
  void initState() {
    super.initState();
  }

  void _print(){
    // 银联订单打印付款结果模版
    FlutterSunmiPrinter.startPrint();
    FlutterSunmiPrinter.reset();
    const imageData = "";
    FlutterSunmiPrinter.printImage(imageData);
    FlutterSunmiPrinter.lineWrap(1);
    FlutterSunmiPrinter.setFontSize(fontSizeType: "SMALL");
    FlutterSunmiPrinter.printTwoColText(firstAlign: "left",firstText:"商户存根(MERCHANT COPY)",secondAlign: "right", secondText: "请妥善保管");
    FlutterSunmiPrinter.printText('------------------------------------------');
    FlutterSunmiPrinter.printText('商户名称: 东莞市网壳科技有限公司');
    FlutterSunmiPrinter.printText('MERCHANT NAME');
    FlutterSunmiPrinter.printText('商户编号: 123456');
    FlutterSunmiPrinter.printText('MERCHANT NO');
    FlutterSunmiPrinter.printTwoColText(firstText: '终端编号: 123456',firstAlign:'left',secondText:'发卡行: 中国银联支付标记',secondAlign:'left');
    FlutterSunmiPrinter.printTwoColText(firstText:'TERCHANT NO',firstAlign:'left',secondText:'ISS',secondAlign:'left');
    FlutterSunmiPrinter.printText('卡号: (CARD NO)');
    FlutterSunmiPrinter.printText('123123123');
    FlutterSunmiPrinter.printText('2020-02-02 02:02:02');
    FlutterSunmiPrinter.printText('TRADE TIME');
    FlutterSunmiPrinter.setBold();
    FlutterSunmiPrinter.printText('消费(SALE)');
    FlutterSunmiPrinter.cancelBold();
    FlutterSunmiPrinter.printText('TRANS TYPE');
    FlutterSunmiPrinter.printTwoColText(firstText:'参考号: 123123',firstAlign:'left',secondText:'批次号: 123123',secondAlign:'left');
    FlutterSunmiPrinter.printTwoColText(firstText:'REFER NO',firstAlign:'left',secondText:'BATCH NO',secondAlign:'left');
    FlutterSunmiPrinter.printTwoColText(firstText:'授权码: 000000',firstAlign:'left',secondText:'凭证号: 123123',secondAlign:'left');
    FlutterSunmiPrinter.printTwoColText(firstText:'AUTH NO',firstAlign:'left',secondText:'VOUCHER NO',secondAlign:'left');
    FlutterSunmiPrinter.setBold();
    FlutterSunmiPrinter.setFontSize(fontSizeType: 'DEFAULT');
    FlutterSunmiPrinter.printAvgTwoColText(firstText:'金额: ¥10000',firstAlign:'left',secondText:'RMB',secondAlign:'left');
     FlutterSunmiPrinter.cancelBold();
    FlutterSunmiPrinter.setFontSize(fontSizeType: 'SMALL');
    FlutterSunmiPrinter.printText('AMOUNT');
    FlutterSunmiPrinter.printText('------------------------------------------');
    FlutterSunmiPrinter.printText('持卡人签名(CARDHOLDER SIGNATURE)');
    FlutterSunmiPrinter.lineWrap(3);
    FlutterSunmiPrinter.printText('------------------------------------------');
    FlutterSunmiPrinter.printText('本人确认以上交易，同意计入本账户');
    FlutterSunmiPrinter.printText('I ACKNOWLEDGE SATISFACTORY RECEIPT OF RELATIVE GOODS/SERVICES');
    FlutterSunmiPrinter.printText('服务热线(CUSTOMER SERVICE HOT LINE):400-720-8888');
    FlutterSunmiPrinter.printText('赢客来提供技术支持');
    FlutterSunmiPrinter.printText('赢客来收银 V2.0');
    FlutterSunmiPrinter.lineWrap(3);
    FlutterSunmiPrinter.lineWrap(1);
    FlutterSunmiPrinter.stopPrint();
  }

  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      home: Scaffold(
        appBar: AppBar(
          title: const Text('Plugin example app'),
        ),
        body: Center(
          child: Column(
            mainAxisSize: MainAxisSize.min,
            children: <Widget>[
              Text(
                  'Running on: test\n'
              ),
              const SizedBox(height: 30),
              RaisedButton(
                onPressed: _print,
                child: const Text(
                    '打印',
                    style: TextStyle(fontSize: 20)
                ),
              ),
            ],
          ),
        ),
      ),
    );
  }
}
